import "./App.css";
import Axios from "axios";

function App() {
  const getJoke = () => {
    Axios.get('https://official-joke-api.appspot.com/random_joke')
    .then((response) => console.log(response))
  };
  return <div className="App">Hello YouTube!
  <button>Click For Joke</button></div>;
}

export default App;
